import React from 'react';

const MencionedMembers : React.FC = () => {
    return(
        <ul className="list-group" style={{ textAlign: "start" }}>
            <button type="button" className="list-group-item">@Daniel Cassiano</button>
            <button type="button" className="list-group-item">@Lucas Carvalho</button>
            <button type="button" className="list-group-item">@Kaline Estevam</button>
            <button type="button" className="list-group-item">@Romero Caetano</button>
        </ul>
    );
}

export default MencionedMembers;
